import React, { useEffect, useState } from "react";
import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import { Paper, Button } from "@mui/material";
import Box from "@mui/material/Box";
import { Splide, SplideSlide } from "@splidejs/react-splide";
import "@splidejs/react-splide/css";
import Chip from "@mui/material/Chip";
import CoffeeIcon from "@mui/icons-material/Coffee";
import SportsBarIcon from "@mui/icons-material/SportsBar";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import { Link } from "react-router-dom";

function ProfileCard({ userId }) {
  const [userData, setUsersData] = useState([]);
  const [profilePictures, setProfilePictures] = useState([]);
  useEffect(() => {
    getProfilePictures();
    getUserData();
  }, []);

  const getUserData = async () => {
    console.log("getting user data");
    const response = await fetch(`./FakeData/UsersData.json`);
    const dataText = await response.text();
    const data = await response.json();
    console.log(`data: ${dataText}`);
    for (let user in data.Users) {
      if (user.UserId == userId) {
        setUsersData(user);
        console.log(`selected user: ${user}`);
      } else {
        console.log(`UserId not found: ${userId}`);
      }
    }
  };

  const getProfilePictures = async () => {
    console.log("getting profile pictures");
    const response = await fetch(`./FakeData/ProfilePictures.json`);
    const data = await response.json();
    setProfilePictures(data.ProfilePictures);
  };

  return (
    <Card sx={{ maxWidth: 345 }}>
      <Splide
        aria-label="ProfilePictures"
        options={{
          rewind: true,
        }}
      >
        {profilePictures.map((pic) => (
          <SplideSlide>
            <CardMedia
              component="img"
              alt={pic.PictureTitle}
              height="140"
              image={pic.Path}
            />
            <Typography
              variant="h5"
              sx={{
                position: "absolute",
                bottom: "10px",
                left: "20px",
                color: "White",
                backgroundColor: "rgba(0, 0, 0, 0.2)",
              }}
            >
              {userData.UserName}
            </Typography>
          </SplideSlide>
        ))}
      </Splide>
      <CardContent style={{ padding: 7 }}>
        <Typography color="text.secondary">
          <h3>About me:</h3>
          <h4>Canâ€™t seem to recall where I stole this bio from or why.</h4>
        </Typography>
        <Typography color="text.secondary">
          <br />
          <h3>Hobbies:</h3>
        </Typography>
        <Box
          sx={{
            margin: 0.5,
            width: 0.999,
            //  border: 1,
            p: 1,
            display: "block",
          }}
        >
          <Chip icon={<CoffeeIcon />} size="small" label="Coffee" />
          <Chip icon={<CoffeeIcon />} size="small" label="Coffee" />
          <Chip icon={<CoffeeIcon />} size="small" label="Coffee" />
          <Chip icon={<CoffeeIcon />} size="small" label="Coffee" />
          <Chip icon={<CoffeeIcon />} size="small" label="Coffee" />
          <Typography color="text.secondary">
            <br />
            <h3>Fetches made happen:</h3>
          </Typography>
          <List dense={true}>
            <ListItem>
              <ListItemIcon>
                <CoffeeIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText
                primary={
                  <Typography color="text.secondary">
                    <h4>Fetched coffee with Yoav</h4>
                  </Typography>
                }
              />
            </ListItem>
            <ListItem>
              <ListItemIcon>
                <SportsBarIcon fontSize="small" />
              </ListItemIcon>
              <ListItemText
                primary={
                  <Typography color="text.secondary">
                    <h4>Fetched beer with Inbar</h4>
                  </Typography>
                }
              />
            </ListItem>
          </List>
        </Box>
        <Box display="flex" justifyContent="center" alignItems="center">
          <Button component={Link} to="/chats" variant="contained">
            Fetch Chat!
          </Button>
        </Box>
      </CardContent>
    </Card>
  );
}

export default ProfileCard;
